script: |
  super -f text -I q5749.spq | sort > q5749.out

inputs:
  - name: q5749.spq
    data: |
      SELECT DISTINCT + - COUNT ( * ) / - 68 + ( 38 ) FROM tab1 (FORMAT parquet) AS cor0 CROSS JOIN tab2 (FORMAT parquet) AS cor1;
  - name: tab1
  - name: tab2

outputs:
  - name: q5749.out
    data: |
      38
